// ------------------------------------------------------------------------------------------------
//   Ver  :| Author            :| Mod. Date :| Changes Made:
//
// ------------------------------------------------------------------------------------------------
module b2p_2lane_ipgen_lscc_driver (
    input wire reset_byte_n_i, 
    input wire reset_pixel_n_i, 
    input wire clk_pixel_i, 
    input wire clk_byte_i, 
    input wire active_lp_pix_sync, 
    input wire payload_done_pix_sync, 
    input wire fifo_almost_full, 
    output reg lp_av_fdbk_sync, 
    output reg payload_done_fdbk_sync, 
    output reg fifo_almost_full_sync) ;
    reg lp_av_fdbk_meta ; //MEME
    //reg                             lp_av_fdbk_sync;
    reg payload_done_fdbk_meta ; //MEME
    //reg                             payload_done_fdbk_sync;
    reg fifo_almost_full_meta ; //MEME
    //reg                             fifo_almost_full_sync;
    always
        @(posedge clk_byte_i or 
            negedge reset_byte_n_i)
        begin
            //MEME
            if ((~reset_byte_n_i)) 
                begin
                    lp_av_fdbk_meta <=  0 ;//MEME
                    lp_av_fdbk_sync <=  0 ;
                    payload_done_fdbk_meta <=  0 ;
                    payload_done_fdbk_sync <=  0 ;
                end
            else
                begin
                    lp_av_fdbk_meta <=  active_lp_pix_sync ;//MEME
                    lp_av_fdbk_sync <=  lp_av_fdbk_meta ;//MEME
                    payload_done_fdbk_meta <=  payload_done_pix_sync ;
                    payload_done_fdbk_sync <=  payload_done_fdbk_meta ;
                end
        end
    always
        @(posedge clk_pixel_i or 
            negedge reset_pixel_n_i)
        begin
            //MEME
            if ((~reset_pixel_n_i)) 
                begin
                    fifo_almost_full_meta <=  0 ;
                    fifo_almost_full_sync <=  0 ;
                end
            else
                begin
                    fifo_almost_full_meta <=  fifo_almost_full ;
                    fifo_almost_full_sync <=  fifo_almost_full_meta ;
                end
        end
endmodule




