//  rx_fifo.v : previous versions assume in and out clocks have the same frequency
//             (generated from the same clock source) so that no time
//             difference will be accumulated, only phase shift exists.
//  
//             this version removes this assumption. this module now includes fsm to manage a pair 
//             of pingpong registers to  buffer data from the clock strobe (stoppable byteclock)
//             to the continuously running byteclock domain. D-PHY protocol does not allow for 
//             data flow control, so the receiver must provide  enough data buffering.
//
//
