module b2p_2lane_ipgen_lscc_pixcntr #(parameter [15:0] NUM_PIXELS = 1, 
        parameter WORD_CNT = 120, 
        parameter DT = 6'h2B) (
    //parameter                                RX_TYPE             = "DSI"
    input wire reset_byte_n_i, 
    input wire clk_byte_i, 
    input wire reset_pixel_n_i, 
    input wire clk_pixel_i, 
    input wire active_lp_pix_p, 
    input wire active_lp_pix_p_6r, 
    input wire de_c, 
    input wire [15:0] wc_byte, 
    output reg [15:0] pix_out_cntr, 
    output reg [15:0] wc_pix_sync, 
    output reg [18:0] pixcnt_c) ;
    localparam RAW8 = 6'h2A ; 
    localparam RAW10 = 6'h2B ; 
    localparam RAW12 = 6'h2C ; 
    localparam YUV420_8 = 6'h18 ; 
    localparam LEGACY_YUV420_8 = 6'h1A ; 
    localparam YUV420_8_CSPS = 6'h1C ; 
    localparam YUV422_8 = 6'h1E ; 
    localparam YUV420_10 = 8'h19 ; 
    localparam YUV420_10_CSPS = 8'h1D ; 
    localparam YUV422_10 = 8'h1F ; 
    localparam RGB888 = 6'h24 ; 
    localparam RGB565 = 6'h22 ; 
    localparam MIN_PIX // straightforward packing. 8bit in to 8bit out
        // straightforward packing 8bit in to 8bit out
        // straightforward packing 8bit in to 8bit out
        // straightforward packing 8bit in to 8bit out
         = ((DT == RAW8) ? 1 : ((DT == RAW10) ? 4 : ((DT == RAW12) ? 2 : ((DT == YUV420_8) ? 1 : ((DT == LEGACY_YUV420_8) ? 1 : ((DT == YUV420_8_CSPS) ? 1 : ((DT == YUV422_8) ? 1 : ((DT == YUV420_10) ? 4 : ((DT == YUV420_10_CSPS) ? 4 : ((DT == YUV422_10) ? 4 : ((DT == RGB888) ? 1 : ((DT == RGB565) ? 1 : 1)))))))))))) ; 
    localparam MIN_BYTE // straightforward packing 8bit in to 8bit out
        // straightforward packing 8bit in to 8bit out
        // straightforward packing 8bit in to 8bit out
        // straightforward packing 8bit in to 8bit out
         = ((DT == RAW8) ? 1 : ((DT == RAW10) ? 5 : ((DT == RAW12) ? 3 : ((DT == YUV420_8) ? 1 : ((DT == LEGACY_YUV420_8) ? 1 : ((DT == YUV420_8_CSPS) ? 1 : ((DT == YUV422_8) ? 1 : ((DT == YUV420_10) ? 5 : ((DT == YUV420_10_CSPS) ? 5 : ((DT == YUV422_10) ? 5 : ((DT == RGB888) ? 3 : ((DT == RGB565) ? 2 : 1)))))))))))) ; 
    localparam [15:0] DEF_PIXCNT = ((WORD_CNT / MIN_BYTE) * MIN_PIX) ; 
    // default pixel count is PXCNT = WORD_COUNT / MIN_BYTE * MIN_PIX
    // ex. DEF_PXCNT for RAW10       = {(WORD_CNT/5)*4}; // 4 pixels is 5 bytes
    reg [15:0] pix_out_dec ; 
    //reg [18:0]                       pixcnt_c;
    reg [18:0] pixcnt_r ; 
    //reg [15:0]                       pix_out_cntr;
    //CDC handling : used loading signal active_lp_pix_p to load the wc_i in the pixel clock domain
    always
        @(posedge clk_pixel_i or 
            negedge reset_pixel_n_i)
        begin
            if ((~reset_pixel_n_i)) 
                begin
                    wc_pix_sync <=  WORD_CNT ;
                end
            else
                begin
                    if (active_lp_pix_p) 
                        wc_pix_sync <=  wc_byte ;
                end
        end
    //number of pixel clock cycles for the pd_o   
    always
        @(*)
        begin
            pix_out_dec = (pix_out_cntr - NUM_PIXELS) ;
        end
    //-------- CSI-2 pixcnt -----------------------------------------
    generate
        begin : CSI2_pixcnt
            always
                @(*)
                begin
                    case (DT)
                    RAW8 : 
                        pixcnt_c = wc_pix_sync ;
                    RAW10 : 
                        pixcnt_c = {(wc_pix_sync / 5),
                                2'b00} ;
                    RAW12 : 
                        pixcnt_c = ({wc_pix_sync,
                                1'b0} / 3) ;
                    YUV420_8 : 
                        //wc*8/12
                        pixcnt_c = wc_pix_sync ;
                    LEGACY_YUV420_8 : 
                        pixcnt_c = wc_pix_sync ;
                    YUV420_8_CSPS : 
                        pixcnt_c = wc_pix_sync ;
                    YUV422_8 : 
                        pixcnt_c = wc_pix_sync ;
                    YUV420_10 : 
                        pixcnt_c = ({wc_pix_sync,
                                2'b00} / 5) ;
                    YUV420_10_CSPS : 
                        pixcnt_c = ({wc_pix_sync,
                                2'b00} / 5) ;
                    YUV422_10 : 
                        pixcnt_c = ({wc_pix_sync,
                                2'b00} / 5) ;
                    RGB888 : 
                        pixcnt_c = (wc_pix_sync / 3) ;
                    RGB565 : 
                        pixcnt_c = wc_pix_sync[15:1] ;
                    default : 
                        //wc/2
                        pixcnt_c = wc_pix_sync ;
                    endcase 
                end
        end
    endgenerate
    always
        @(posedge clk_pixel_i or 
            negedge reset_pixel_n_i)
        begin
            if ((~reset_pixel_n_i)) 
                begin
                    pixcnt_r <=  DEF_PIXCNT ;
                end
            else
                begin
                    pixcnt_r <=  pixcnt_c[15:0] ;
                end
        end
    always
        @(posedge clk_pixel_i or 
            negedge reset_pixel_n_i)
        begin
            if ((~reset_pixel_n_i)) 
                begin
                    pix_out_cntr <=  DEF_PIXCNT ;
                end
            else
                begin
                    // multicycle path: wc_pix_sync to pix_out_cntr  
                    // - cleared on same cycle as last_pix_cyc_r
                    if (active_lp_pix_p_6r) 
                        // was active_lp_pix_p_r. delay  due to setup violation (wc_pix_sync to pix_out_cntr) 
                        pix_out_cntr <=  pixcnt_c[15:0] ;
                    else
                        if ((de_c && (pix_out_cntr >= NUM_PIXELS))) 
                            //do not decrement if less than num_pixels   
                            pix_out_cntr <=  pix_out_dec ;
                        else
                            pix_out_cntr <=  pix_out_cntr ;
                end
        end
endmodule



